import './Shoji.css'

import { Container } from "react-bootstrap";

import Main from './Main/Main';
import Product from './Product/Product';
import Fashion from './Fashion/Fashion';
import Posts from './Posts/Posts';

function Shoji(){
    return(
        <Container fluid>
            <Main></Main>
            <Product></Product>
            <Fashion></Fashion>
            <Posts></Posts>
        </Container>
    )
}

export default Shoji
